import SearchResult from "../../pages/search/SearchResult";

const Notifications = ({collapse}) => {
    return (
        <section>
            {collapse && (
                <div className="search-bar" >
                    <div>
                        <h1>Notifications</h1>

                    </div>
                    <div className="search-preview">

                    </div>
                </div>
            )}
        </section>
    )
}

export default Notifications
